static char __pyx_k_193[] = "A datetime field.\n\n    Note: Microseconds are rounded to the nearest millisecond.\n      Pre UTC microsecond support is effecively broken.\n      Use :class:`~mongoengine.fields.ComplexDateTimeField` if you\n      need accurate microsecond support.\n    ";
static char __pyx_k_215[] = "\n    ComplexDateTimeField handles microseconds exactly instead of rounding\n    like DateTimeField does.\n\n    Derives from a StringField so you can do `gte` and `lte` filtering by\n    using lexicographical comparison when filtering / sorting strings.\n\n    The stored string has the following format:\n\n        YYYY,MM,DD,HH,MM,SS,NNNNNN\n\n    Where NNNNNN is the number of microseconds of the represented `datetime`.\n    The `,` as the separator can be easily modified by passing the `separator`\n    keyword when initializing the field.\n\n    .. versionadded:: 0.5\n    ";
static char __pyx_k_230[] = "An embedded document field - with a declared document_type.\n    Only valid values are subclasses of :class:`~mongoengine.EmbeddedDocument`.\n    ";
static char __pyx_k_239[] = "A generic embedded document field - allows any\n    :class:`~mongoengine.EmbeddedDocument` to be stored.\n\n    Only valid values are subclasses of :class:`~mongoengine.EmbeddedDocument`.\n\n    .. note:: You can use the choices param to limit the acceptable\n    EmbeddedDocument types\n    ";
static char __pyx_k_246[] = "A truly dynamic field type capable of handling different and varying\n    types of data.\n\n    Used by :class:`~mongoengine.DynamicDocument` to handle dynamic data";
static char __pyx_k_254[] = "A list field that wraps a standard field, allowing multiple instances\n    of the field to be used as a list in the database.\n\n    If using with ReferenceFields see: :ref:`one-to-many-with-listfields`\n\n    .. note::\n        Required means it cannot be empty - as the default for ListFields is []\n    ";
static char __pyx_k_259[] = "A ListField that sorts the contents of its list before writing to\n    the database in order to ensure that a sorted list is always\n    retrieved.\n\n    .. warning::\n        There is a potential race condition when handling lists.  If you set /\n        save the whole list then other processes trying to save the whole list\n        as well could overwrite changes.  The safest way to append to a list is\n        to perform a push operation.\n\n    .. versionadded:: 0.4\n    .. versionchanged:: 0.6 - added reverse keyword\n    ";
static char __pyx_k_269[] = "A dictionary field that wraps a standard Python dictionary. This is\n    similar to an embedded document, but the structure is not defined.\n\n    .. note::\n        Required means it cannot be empty - as the default for ListFields is []\n\n    .. versionadded:: 0.3\n    .. versionchanged:: 0.5 - Can now handle complex / varying types of data\n    ";
static char __pyx_k_273[] = "A field that maps a name to a specified field type. Similar to\n    a DictField, except the 'value' of each item must match the specified\n    field type.\n\n    .. versionadded:: 0.5\n    ";
static char __pyx_k_288[] = "A reference to a document that will be automatically dereferenced on\n    access (lazily).\n\n    Use the `reverse_delete_rule` to handle what should happen if the document\n    the field is referencing is deleted.  EmbeddedDocuments, DictFields and\n    MapFields do not support reverse_delete_rules and an `InvalidDocumentError`\n    will be raised if trying to set on one of these Document / Field types.\n\n    The options are:\n\n      * DO_NOTHING  - don't do anything (default).\n      * NULLIFY     - Updates the reference to null.\n      * CASCADE     - Deletes the documents associated with the reference.\n      * DENY        - Prevent the deletion of the reference object.\n      * PULL        - Pull the reference from a :class:`~mongoengine.ListField` of references\n\n    Alternative syntax for registering delete rules (useful when implementing\n    bi-directional delete rules)\n\n    .. code-block:: python\n\n        class Bar(Document):\n            content = StringField()\n            foo = ReferenceField('Foo')\n\n        Bar.register_delete_rule(Foo, 'bar', NULLIFY)\n\n    .. versionchanged:: 0.5 added `reverse_delete_rule`\n    ";
static char __pyx_k_299[] = "A reference to *any* :class:`~mongoengine.document.Document` subclass\n    that will be automatically dereferenced on access (lazily).\n\n    .. note:: Any documents used as a generic reference must be registered in the\n    document registry.  Importing the model will automatically register it.\n\n    .. note:: You can use the choices param to limit the acceptable Document types\n\n    .. versionadded:: 0.3\n    ";
